export function register (perro){

  var url = 'http://localhost:5000/registro'
  var datosReg = {
  correo: perro.correo,
  password: perro.password,
  fecha:"hoy",
  nombre:"Pc",
  confirmation:perro.confirmation,
  age: perro.age
};

  return fetch( url , {
    method: 'POST',
    body : JSON.stringify( datosReg ),
    headers: {
      'Content-Type' : 'application/json'
    }
  });
}
